import React, { useEffect, useState } from "react";
import logo from "../asset/areocovert-logo.svg";
import { toast } from "react-toastify";
import Spinner from "../component/Spinner";
import { LogOut } from "../utils/firebase/AuthFirestore";
import { observer } from "mobx-react-lite";
import { auth } from "../firebase/firebase";

const Navbar = () => {
  const [isNavVisible, setIsNavVisible] = useState(false);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Your useEffect logic here
  }, [auth.currentUser]);

  const handleSignOut = async (e) => {
    // Your handle sign out logic here
  };

  const toggleNavVisibility = () => {
    setIsNavVisible(!isNavVisible);
  };

  return (
    <div className="bg-[#fff] flex justify-between items-center fixed top-0 left-0 w-full z-10 px-6 md:px-10 lg:px-16 xl:px-24 h-[104px]">
      {loading && <Spinner />}

      <div>
        <img src={logo} alt="logo" />
      </div>

      <div className="hidden md:flex items-center gap-[40px]">
        <ul className="flex justify-between">
          <li>Home</li>
          <li>About</li>
          <li>Service</li>
          <li>Contact</li>
        </ul>
      </div>

      <div className="hidden md:flex gap-7">
        <button onClick={() => { window.location.href = "/login"; }}>Login</button>
        <button onClick={() => { window.location.href = "/register"; }}>Sign Up</button>
      </div>

      <div className="cursor-pointer md:hidden" onClick={toggleNavVisibility}>
        {isNavVisible ? (
          <span>&#10005;</span> // X icon
        ) : (
          <span>&#9776;</span> // Bar icon
        )}
      </div>

      <div className={` ${isNavVisible ? "block" : "hidden"} fixed top-[104px] left-0 w-full bg-[#fff] px-6 py-4`}>
        <ul className="flex flex-col gap-4">
          <li>Home</li>
          <li>About</li>
          <li>Service</li>
          <li>Contact</li>
          <li onClick={() => { window.location.href = "/login"; }}>Login</li>
          <li onClick={() => { window.location.href = "/register"; }}>Sign Up</li>
        </ul>
      </div>
    </div>
  );
};

export default observer(Navbar);
